import React from "react";
import TopNav from '../components/Navbar/TopNav';
import Cart_product from '../components/Cart_product';
import MariaFloristaFavourite from '../components/MariaFloristaFavourite';
import { useNavigate } from 'react-router-dom';



const Cart1 = () => {
    const navigate = useNavigate();

    function cart() {
      navigate('/cart');
    }

    return(
        <div className='full_div'>
            <TopNav />
            <center><h1 className="product_textS">This is your Cart</h1></center>
            <center><h3>You can add items to your cart by clicking the "Add to Cart" button </h3></center>



            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '80%', margin: '0 auto' }}>
                <div style={{ border: '2px solid green', padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '100%' }}>
                    <div><h3>Your Cart</h3></div>
                    <Cart_product></Cart_product>
                </div>
            </div>

        </div>
    );
}
export default Cart1;
